Description:
Luxurious Chic Apartment in the Perfect Location
When size counts. This apartment is approx. 52 sqm of
living and approx a 8.4 sqm balcony
- Beautiful flooring;
- Generous open plan living/dining/kitchen area, opening on
to a sunny balcony with views over looking the courtyard
and pool;
- Well-appointed hostess kitchen including microwave and
dishwasher;
- One bedroom with built-in robes
- Spacious centrally positioned designer bathroom;
- European-style laundry facility with excellent storage;
- Security off street parking;
- Storage cage
- Fully furnished - Optional
Superbly located just 250 m to South Yarra Railway Station, trams and Toorak Road. It is only 400m to the much celebrated Chapel Street with its plethora of cafes, restaurants and shops, this is 3141 at its best.
Internal area
57m²
